//single Header component that appears on multiple pages
//with a Navigation component within it that's used to conditionally render
//About Me, Portfolio, Contact, and Resume sections.
import React from "react";

//create a Header component that also styles with tailwind css classes
const Header = () => {
  return (
    <div className="flex flex-wrap items-center justify-between p-4 background-color bg-black color border-blue-900">
      <h1 className="text-4xl font-bold">
        <span className="text-blue-500">Jordan Hackworth Portfolio</span>
      </h1>{" "}
      <nav className="flex flex-wrap items-center justify-between">
        <a href="#about" className="text-blue-500 hover:text-blue-700">
          About Me
        </a>
        <a href="#portfolio" className="text-blue-500 hover:text-blue-700">
          Portfolio
        </a>
        <a href="#contact" className="text-blue-500 hover:text-blue-700">
          Contact
        </a>
        <a href="#resume" className="text-blue-500 hover:text-blue-700">
          Resume
        </a>
      </nav>
    </div>
  );
};

export default Header;
